import React from "react";

const Card = ({ trainer, key }) => {
  return (
    <div className="card">
      <p>{trainer.name}</p>
      <button>Add Pokemon</button>
      <ul>
          {trainer.pokemons.map(pokemon => {
              return (< Pokemon pokemon={pokemon} />)
          })}
      </ul>
    </div>
  );
};

export default Card;
